import React, { useState } from 'react'
import './MySkills.css'
import Aos from 'aos'
Aos.init()


export default function MySkills() {


    const [Html, setHtml] = useState(90)
    const [Css, setCss] = useState(0)
    const [JavaScript, setJavascript] = useState(0)
    const [React, setReact] = useState(0)
    const [NodeJs, setNodeJs] = useState(0)
    const [Mongodb, setMongodb] = useState(0)
    const [StopLoop, setStopLoop] = useState(200)

    

    // if(StopLoop > 200){

    //     // setHtml(90)
    //     // setCss(95)
    //     // setJavascript(70)
    //     // setReact(75)
    //     // setNodeJs(80)
    //     // setMongodb(85)
    //     setStopLoop(StopLoop+1)
        

    //     // setHtml(0)
        
    //     setInterval(()=>{
    //         if(Html === 10){
    //             clearInterval();
                
    //         }
    //         else{
    //             setHtml(Html + 1)
    //         }
    //     },200)



    // }





    return (
        <div className="MySkills-parents">

        <div className="title">
            <h1> Skills </h1>
        </div>

            <div className="html bar oneBar ">
                <div className="skills-icon"><i class="fab fa-html5 fa-4x"></i>  </div>
                    <div className="skills-bar">  
                        
                    <div className="progressBar"> <div className="progressBar-inner" data-aos="html" > </div></div>

                    <p> {St ===90 ? setHtml(100) : setHtml(Html+1) }% </p>
                </div> 
            </div>

            

            
            <div className="css bar twoBar">
                <div className="skills-icon"><i class="fab fa-css3-alt fa-4x"></i>  </div>
                    <div className="skills-bar">  
                    
                    <div className="progressBar"> <div className="progressBar-inner" data-aos="css" > </div></div>

                    <p> {Html}% </p>
                </div> 
            </div>

            
            <div className="javaScript bar oneBar ">
                <div className="skills-icon"><i class="fab fa-js-square fa-4x"></i>  </div>
                    <div className="skills-bar">  
                    
                    <div className="progressBar"> <div className="progressBar-inner" data-aos="js"> </div></div>

                    <p> {Html}% </p>
                </div> 
            </div>


            
            <div className="react bar twoBar">
                <div className="skills-icon"><i class="fab fa-react fa-4x"></i>  </div>
                    <div className="skills-bar">  
                    
                    <div className="progressBar"> <div className="progressBar-inner" data-aos="react"> </div></div>

                    <p> {Html}% </p>
                </div> 
            </div>

            
            <div className="nodeJs bar oneBar ">
                <div className="skills-icon"><i class="fab fa-node fa-4x"></i>  </div>
                    <div className="skills-bar">  
                        
                    <div className="progressBar"> <div className="progressBar-inner" data-aos="node"> </div></div>

                    <p> {Html}% </p>
                </div> 
            </div>

            
            <div className="mongodb bar twoBar">
                <div className="skills-icon"><i class="fab fa-mdb fa-4x"></i>  </div>
            <div className="skills-bar">  
                        
                    <div className="progressBar"> <div className="progressBar-inner" data-aos="mongo"> </div></div>

                    <p> {Html}% </p>
                </div> 
            </div>
        </div>
    )
}
